import { Outlet, Link } from "react-router-dom";
import './Layout.css';

const Layout = () => {
  return (
    <>
    <nav class="navbar navbar-expand-lg navbar-light">
      <div class="container-fluid">
        <ul class="navbar-nav">
          <li class="nav-item">
            <Link class="nav-link" id="logo" to="/">Rant Book</Link>
          </li>
          <li class="nav-item">
            <Link class="nav-link" to="/">Feed</Link>
            <Link class="nav-link" to="/rant">Rant</Link>
            <Link class="nav-link" to="/people">People</Link>
          </li>
        </ul>
      </div>
    </nav>

    <Outlet />
    </>
)
};

export default Layout;
